                    <TestimonialCard className='col-xs-1'/>
                    <TestimonialCard className='col-xs-1'/>
                    <TestimonialCard className='col-xs-1'/>
                </div>
            </div>
            <Footer data={landingPageData.Contact} />
        </div>
    );
};
